import ExpenseItem from './ExpenseItem'

const i = (props) => {
    return (
        <div className = "i">
            <ExpenseItem title = {props.i[0].title} amount = {i[0].amount} date = {(i[0].date)}/>
            <ExpenseItem title = {i[1].title} amount = {i[1].amount} date = {(i[1].date)}/>
            <ExpenseItem title = {i[2].title} amount = {i[2].amount} date = {(i[2].date)}/>
            <ExpenseItem title = {i[3].title} amount = {i[3].amount} date = {(i[3].date)}/>
        </div>
    );
}

export default i;
